webpackJsonp([0x856736e06133],{1272:function(t,e){t.exports={data:{markdownRemark:{html:'<p>3rd week into my new job and I’ve got a ton to think about, especially as concerns xAPI and Caliper. Thinking maybe now’s a good time to try installing an LRS at home? What have you been making this week? This week, I’ve:</p>\n<ul>\n<li><strong>Adding</strong> a presentation layer to my Google Charts data viz using the bootstrap framework.</li>\n<li><strong>Automating</strong> the translation of the original clickstream data for the Google Charts using formulas in Excel. My first foray into using formulas!</li>\n<li><strong>Designing</strong> my first Free Code Camp front-end project, a one-page portfolio also built on the bootstrap framework. Take a look at the work-in-progress: <a href="http://codepen.io/anthkris/full/xwpPrE/">http://codepen.io/anthkris/full/xwpPrE/</a></li>\n<li><strong>Reading up</strong> on xAPI and the new Caliper spec.</li>\n</ul>',frontmatter:{date:"October 23, 2015",path:"/blog/weeknotes-1023",title:"Weeknotes 10/23",tags:["weeknotes"],categories:["Weeknotes"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:2,src:"/static/WeekNotes-10-23-79f93867ddda98fcc2536fac7fcdb9fc-81d39.png",srcSet:"/static/WeekNotes-10-23-79f93867ddda98fcc2536fac7fcdb9fc-9a8d1.png 203w,\n/static/WeekNotes-10-23-79f93867ddda98fcc2536fac7fcdb9fc-c53f9.png 405w,\n/static/WeekNotes-10-23-79f93867ddda98fcc2536fac7fcdb9fc-81d39.png 810w,\n/static/WeekNotes-10-23-79f93867ddda98fcc2536fac7fcdb9fc-fda19.png 1024w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
